selector_to_html = {"a[href=\"#undici-types\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">undici-types<a class=\"headerlink\" href=\"#undici-types\" title=\"Link to this heading\">#</a></h1><p>This package is a dual-publish of the <a class=\"tippyAnchor reference external\" href=\"https://www.npmjs.com/package/undici\">undici</a> library types. The <code class=\"docutils literal notranslate\"><span class=\"pre\">undici</span></code> package <strong>still contains types</strong>. This package is for users who <em>only</em> need undici types (such as for <code class=\"docutils literal notranslate\"><span class=\"pre\">@types/node</span></code>). It is published alongside every release of <code class=\"docutils literal notranslate\"><span class=\"pre\">undici</span></code>, so you can always use the same version.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
